tore.createId(); // Genera un ID nico\n    \n    const userData: User = {\n      uid: user.uid,\n      email: user.email,\n      name: user.displayName,\n      createdAt: new Date()\n    };\n    \n    return this.firestore.collection('users').add(userData);\n  }\n  //Mtodo para login con email y contrasea\n  loginWithEmailPassword(email: string, password: string) {\n    return this.auth.signInWithEmailAndPassword(email, password);\n  }\n\n  // Mtodo para login\n  login(email: string, password: string): Observable {\n    return from(this.auth.signInWithEmailAndPassword(email, password));\n  }\n\n  // Mtodo para verificar si el usuario est autenticado\n  isAuthenticated(): Observable {\n    return this.auth.authState.pipe(\n      map(user => user !== null)\n    );\n  }\n\n  // Mtodo para cerrar sesin\n  logout(): Observable {\n    return from(this.auth.signOut());\n  }\n\n  registerUser(userRegistration: UserRegistration): Observable {\n    return from(\n      this.auth.createUserWithEmailAndPassword(\n        userRegistration.email,\n        userRegistration.password\n      )\n    ).pipe(\n      switchMap(async (userCredential) => {\n        await this.setUserData({\n          uid: userCredential.user?.uid,\n          email: userCredential.user?.email,\n          displayName: userRegistration.displayName\n        });\n        \n        return {\n          success: true,\n          user: userCredential.user\n        };\n      })\n    );\n  }\n\n  async signInWithGoogle(): Promise {\n    try {\n      const provider = new GoogleAuthProvider();\n      const result = await this.auth.signInWithPopup(provider);\n      \n      await this.setUserData({\n        uid: result.user?.uid,\n        email: result.user?.email,\n        displayName: result.user?.displayName\n      });\n      \n      return {\n        success: true,\n        user: result.user\n      };\n    } catch (error) {\n      console.error('Error en signInWithGoogle:', error);\n      return {\n        success: false,\n        message: 'Error al iniciar sesin con Google'\n      };\n    }\n  }\n\n  async signInWithFacebook(): Promise {\n    try {\n      const provider = new FacebookAuthProvider();\n      const result = await this.auth.signInWithPopup(provider);\n      \n      await this.setUserData({\n        uid: result.user?.uid,\n        email: result.user?.email,\n        displayName: result.user?.displayName\n      });\n      \n      return {\n        success: true,\n        user: result.user\n      };\n    } catch (error) {\n      console.error('Error en signInWithFacebook:', error);\n      return {\n        success: false,\n        message: 'Error al iniciar sesin con Facebook'\n      };\n    }\n  }\n\n  async signInWithApple(): Promise {\n    try {\n      const provider = new OAuthProvider('apple.com');\n      const result = await this.auth.signInWithPopup(provider);\n      \n      await this.setUserData({\n        uid: result.user?.uid,\n        email: result.user?.email,\n        displayName: result.user?.displayName\n      });\n      \n      return {\n        success: true,\n        user: result.user\n      };\n    } catch (error) {\n      console.error('Error en signInWithApple:', error);\n      return {\n        success: false,\n        message: 'Error al iniciar sesin con Apple'\n      };\n    }\n  }\n}\n\n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"components/BottomNavigationComponent.html":{"url":"components/BottomNavigationComponent.html","title":"component - BottomNavigationComponent","body":"\n                   \n\n\n\n\n\n  Components\n  \n  BottomNavigationComponent\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n        \n            Template\n        \n        \n            Styles\n        \n        \n            DOM Tree\n        \n\n\n\n    \n    File\n\n\n    src/app/components/dashboard/componen